import { __decorate } from "tslib";
import __NG_CLI_RESOURCE__0 from "./app.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./app.component.css?ngResource";
import { Component } from '@angular/core';
import { BackendService } from './backend.service';
import { Router } from '@angular/router';
let AppComponent = class AppComponent {
    constructor(service, route) {
        this.service = service;
        this.route = route;
        this.title = 'moviebookingapp';
        this.status = false;
    }
    logout() {
        this.isAuthenticated = true;
        this.service.status = false;
        this.service.adminStatus = false;
        this.status = false;
        this.route.navigate(['/']);
    }
};
AppComponent.ctorParameters = () => [
    { type: BackendService },
    { type: Router }
];
